INSERT INTO `products` VALUES (15,'Classic White Crew Neck T-Shirt',1,39.00,'Vall & Asociados S.A.',194,'Elevate your basics with this versatile white crew neck tee. Made from a soft, breathable cotton blend, it offers both comfort and durability. Its sleek, timeless design ensures it pairs well with virtually any outfit. Ideal for layering or wearing on its own, this t-shirt is a must-have staple for every wardrobe.','2024-12-07 05:00:00'),(16,'Classic White Tee - Timeless Style and Comfort',2,73.00,'Egea & Asociados S.Com.',73,'Elevate your everyday wardrobe with our Classic White Tee. Crafted from premium soft cotton material, this versatile t-shirt combines comfort with durability, perfect for daily wear. Featuring a relaxed, unisex fit that flatters every body type, it\'s a staple piece for any casual ensemble. Easy to care for and machine washable, this white tee retains its shape and softness wash after wash. Pair it with your favorite jeans or layer it under a jacket for a smart look.','2024-12-07 05:00:00'),(17,'Classic Black T-Shirt',3,35.00,'Montesinos y Cañellas S.Coop.',166,'Elevate your everyday style with our Classic Black T-Shirt. This staple piece is crafted from soft, breathable cotton for all-day comfort. Its versatile design features a classic crew neck and short sleeves, making it perfect for layering or wearing on its own. Durable and easy to care for, it\'s sure to become a favorite in your wardrobe.','2024-12-07 05:00:00'),(18,'Sleek White & Orange Wireless Gaming Controller',2,69.00,'Hnos Cerdán S.Coop.',113,'Elevate your gaming experience with this state-of-the-art wireless controller, featuring a crisp white base with vibrant orange accents. Designed for precision play, the ergonomic shape and responsive buttons provide maximum comfort and control for endless hours of gameplay. Compatible with multiple gaming platforms, this controller is a must-have for any serious gamer looking to enhance their setup.','2024-12-07 05:00:00'),(19,'Sleek Wireless Headphone & Inked Earbud Set',1,44.00,'Zapata & Asociados S.Coop.',130,'Experience the fusion of style and sound with this sophisticated audio set featuring a pair of sleek, white wireless headphones offering crystal-clear sound quality and over-ear comfort. The set also includes a set of durable earbuds, perfect for an on-the-go lifestyle. Elevate your music enjoyment with this versatile duo, designed to cater to all your listening needs.','2024-12-07 05:00:00'),(20,'Sleek Comfort-Fit Over-Ear Headphones',5,28.00,'Priego & Asociados S.Com.',102,'Experience superior sound quality with our Sleek Comfort-Fit Over-Ear Headphones, designed for prolonged use with cushioned ear cups and an adjustable, padded headband. Ideal for immersive listening, whether you\'re at home, in the office, or on the move. Their durable construction and timeless design provide both aesthetically pleasing looks and long-lasting performance.','2024-12-07 05:00:00'),(21,'Efficient 2-Slice Toaster',3,48.00,'Hernandez y Esparza S.L.U.',73,'Enhance your morning routine with our sleek 2-slice toaster, featuring adjustable browning controls and a removable crumb tray for easy cleaning. This compact and stylish appliance is perfect for any kitchen, ensuring your toast is always golden brown and delicious.','2024-12-07 05:00:00'),(22,'Sleek Wireless Computer Mouse',3,10.00,'Benita Sans Franch S.L.',107,'Experience smooth and precise navigation with this modern wireless mouse, featuring a glossy finish and a comfortable ergonomic design. Its responsive tracking and easy-to-use interface make it the perfect accessory for any desktop or laptop setup. The stylish blue hue adds a splash of color to your workspace, while its compact size ensures it fits neatly in your bag for on-the-go productivity.','2024-12-07 05:00:00'),(23,'Sleek Modern Laptop with Ambient Lighting',1,43.00,'Boada y Carlos S.Coop.',88,'Experience next-level computing with our ultra-slim laptop, featuring a stunning display illuminated by ambient lighting. This high-performance machine is perfect for both work and play, delivering powerful processing in a sleek, portable design. The vibrant colors add a touch of personality to your tech collection, making it as stylish as it is functional.','2024-12-07 05:00:00'),(24,'Sleek Modern Laptop for Professionals',2,97.00,'Soler y Perelló S.L.',79,'Experience cutting-edge technology and elegant design with our latest laptop model. Perfect for professionals on-the-go, this high-performance laptop boasts a powerful processor, ample storage, and a long-lasting battery life, all encased in a lightweight, slim frame for ultimate portability. Shop now to elevate your work and play.','2024-12-07 05:00:00'),(25,'Stylish Red & Silver Over-Ear Headphones',1,39.00,'Fábrica XQZ S.L.L.',119,'Immerse yourself in superior sound quality with these sleek red and silver over-ear headphones. Designed for comfort and style, the headphones feature cushioned ear cups, an adjustable padded headband, and a detachable red cable for easy storage and portability. Perfect for music lovers and audiophiles who value both appearance and audio fidelity.','2024-12-07 05:00:00'),(26,'Sleek Mirror Finish Phone Case',1,27.00,'Inversiones MY S.Coop.',13,'Enhance your smartphone\'s look with this ultra-sleek mirror finish phone case. Designed to offer style with protection, the case features a reflective surface that adds a touch of elegance while keeping your device safe from scratches and impacts. Perfect for those who love a minimalist and modern aesthetic.','2024-12-07 05:00:00'),(27,'Sleek Smartwatch with Vibrant Display',1,16.00,'Fábrica NB S.L.',96,'Experience modern timekeeping with our high-tech smartwatch, featuring a vivid touch screen display, customizable watch faces, and a comfortable blue silicone strap. This smartwatch keeps you connected with notifications and fitness tracking while showcasing exceptional style and versatility.','2024-12-07 05:00:00'),(28,'Sleek Modern Leather Sofa',2,53.00,'Fausto Nieto Ochoa S.L.N.E',190,'Enhance the elegance of your living space with our Sleek Modern Leather Sofa. Designed with a minimalist aesthetic, it features clean lines and a luxurious leather finish. The robust metal legs provide stability and support, while the plush cushions ensure comfort. Perfect for contemporary homes or office waiting areas, this sofa is a statement piece that combines style with practicality.','2024-12-07 05:00:00'),(29,'Mid-Century Modern Wooden Dining Table',2,24.00,'Primitiva Gimenez Vall S.L.U.',198,'Elevate your dining room with this sleek Mid-Century Modern dining table, featuring an elegant walnut finish and tapered legs for a timeless aesthetic. Its sturdy wood construction and minimalist design make it a versatile piece that fits with a variety of decor styles. Perfect for intimate dinners or as a stylish spot for your morning coffee.','2024-12-07 05:00:00'),(30,'Elegant Golden-Base Stone Top Dining Table',4,66.00,'Industrias HWNC S.Coop.',63,'Elevate your dining space with this luxurious table, featuring a sturdy golden metal base with an intricate rod design that provides both stability and chic elegance. The smooth stone top in a sleek round shape offers a robust surface for your dining pleasure. Perfect for both everyday meals and special occasions, this table easily complements any modern or glam decor.','2024-12-07 05:00:00'),(31,'Modern Elegance Teal Armchair',5,25.00,'Miguela Abril Alcalde S.Coop.',86,'Elevate your living space with this beautifully crafted armchair, featuring a sleek wooden frame that complements its vibrant teal upholstery. Ideal for adding a pop of color and contemporary style to any room, this chair provides both superb comfort and sophisticated design. Perfect for reading, relaxing, or creating a cozy conversation nook.','2024-12-07 05:00:00'),(32,'Elegant Solid Wood Dining Table',1,67.00,'Flora Roselló Peiró S.Com.',134,'Enhance your dining space with this sleek, contemporary dining table, crafted from high-quality solid wood with a warm finish. Its sturdy construction and minimalist design make it a perfect addition for any home looking for a touch of elegance. Accommodates up to six guests comfortably and includes a striking fruit bowl centerpiece. The overhead lighting is not included.','2024-12-07 05:00:00'),(33,'Modern Minimalist Workstation Setup',5,49.00,'Tecnologías Ayllón & Asociados S.L.N.E',70,'Elevate your home office with our Modern Minimalist Workstation Setup, featuring a sleek wooden desk topped with an elegant computer, stylish adjustable wooden desk lamp, and complimentary accessories for a clean, productive workspace. This setup is perfect for professionals seeking a contemporary look that combines functionality with design.','2024-12-07 05:00:00'),(34,'Modern Ergonomic Office Chair',4,71.00,'Velasco y Higueras S.Com.',110,'Elevate your office space with this sleek and comfortable Modern Ergonomic Office Chair. Designed to provide optimal support throughout the workday, it features an adjustable height mechanism, smooth-rolling casters for easy mobility, and a cushioned seat for extended comfort. The clean lines and minimalist white design make it a versatile addition to any contemporary workspace.','2024-12-07 05:00:00'),(35,'Futuristic Holographic Soccer Cleats',2,39.00,'Promociones Palacios S.C.P',157,'Step onto the field and stand out from the crowd with these eye-catching holographic soccer cleats. Designed for the modern player, these cleats feature a sleek silhouette, lightweight construction for maximum agility, and durable studs for optimal traction. The shimmering holographic finish reflects a rainbow of colors as you move, ensuring that you\'ll be noticed for both your skills and style. Perfect for the fashion-forward athlete who wants to make a statement.','2024-12-07 05:00:00'),(36,'Rainbow Glitter High Heels',4,39.00,'Hotel del Levante S.A.',42,'Step into the spotlight with these eye-catching rainbow glitter high heels. Designed to dazzle, each shoe boasts a kaleidoscope of shimmering colors that catch and reflect light with every step. Perfect for special occasions or a night out, these stunners are sure to turn heads and elevate any ensemble.','2024-12-07 05:00:00'),(37,'Chic Summer Denim Espadrille Sandals',4,33.00,'Familia Alcolea S.L.N.E',135,'Step into summer with style in our denim espadrille sandals. Featuring a braided jute sole for a classic touch and adjustable denim straps for a snug fit, these sandals offer both comfort and a fashionable edge. The easy slip-on design ensures convenience for beach days or casual outings.','2024-12-07 05:00:00'),(38,'Vibrant Runners: Bold Orange & Blue Sneakers',2,27.00,'Comercializadora del Mediterráneo S.L.L.',86,'Step into style with these eye-catching sneakers featuring a striking combination of orange and blue hues. Designed for both comfort and fashion, these shoes come with flexible soles and cushioned insoles, perfect for active individuals who don\'t compromise on style. The reflective silver accents add a touch of modernity, making them a standout accessory for your workout or casual wear.','2024-12-07 05:00:00'),(39,'Vibrant Pink Classic Sneakers',1,84.00,'Artigas & Asociados S.Com.',123,'Step into style with our Vibrant Pink Classic Sneakers! These eye-catching shoes feature a bold pink hue with iconic white detailing, offering a sleek, timeless design. Constructed with durable materials and a comfortable fit, they are perfect for those seeking a pop of color in their everyday footwear. Grab a pair today and add some vibrancy to your step!','2024-12-07 05:00:00'),(40,'Futuristic Silver and Gold High-Top Sneaker',4,68.00,'Trinidad Prado Gascón S.L.',173,'Step into the future with this eye-catching high-top sneaker, designed for those who dare to stand out. The sneaker features a sleek silver body with striking gold accents, offering a modern twist on classic footwear. Its high-top design provides support and style, making it the perfect addition to any avant-garde fashion collection. Grab a pair today and elevate your shoe game!','2024-12-07 05:00:00'),(41,'Futuristic Chic High-Heel Boots',5,36.00,'Coello y Román S.Com.',90,'Elevate your style with our cutting-edge high-heel boots that blend bold design with avant-garde aesthetics. These boots feature a unique color-block heel, a sleek silhouette, and a versatile light grey finish that pairs easily with any cutting-edge outfit. Crafted for the fashion-forward individual, these boots are sure to make a statement.','2024-12-07 05:00:00'),(42,'Elegant Patent Leather Peep-Toe Pumps with Gold-Tone Heel',3,53.00,'Familia Echevarría S.A.',129,'Step into sophistication with these chic peep-toe pumps, showcasing a lustrous patent leather finish and an eye-catching gold-tone block heel. The ornate buckle detail adds a touch of glamour, perfect for elevating your evening attire or complementing a polished daytime look.','2024-12-07 05:00:00'),(43,'Elegant Purple Leather Loafers',3,17.00,'Desarrollo Donoso & Asociados S.L.N.E',23,'Step into sophistication with our Elegant Purple Leather Loafers, perfect for making a bold statement. Crafted from high-quality leather with a vibrant purple finish, these shoes feature a classic loafer silhouette that\'s been updated with a contemporary twist. The comfortable slip-on design and durable soles ensure both style and functionality for the modern man.','2024-12-07 05:00:00'),(44,'Classic Blue Suede Casual Shoes',5,39.00,'Vidal & Asociados S.Coop.',21,'Step into comfort with our Classic Blue Suede Casual Shoes, perfect for everyday wear. These shoes feature a stylish blue suede upper, durable rubber soles for superior traction, and classic lace-up fronts for a snug fit. The sleek design pairs well with both jeans and chinos, making them a versatile addition to any wardrobe.','2024-12-07 05:00:00'),(45,'Sleek Futuristic Electric Bicycle',5,22.00,'Desarrollo XJWU S.L.L.',85,'This modern electric bicycle combines style and efficiency with its unique design and top-notch performance features. Equipped with a durable frame, enhanced battery life, and integrated tech capabilities, it\'s perfect for the eco-conscious commuter looking to navigate the city with ease.','2024-12-07 05:00:00'),(46,'Sleek All-Terrain Go-Kart',1,37.00,'Infante y Nevado S.A.D',111,'Experience the thrill of outdoor adventures with our Sleek All-Terrain Go-Kart, featuring a durable frame, comfortable racing seat, and robust, large-tread tires perfect for handling a variety of terrains. Designed for fun-seekers of all ages, this go-kart is an ideal choice for backyard racing or exploring local trails.','2024-12-07 05:00:00'),(47,'Radiant Citrus Eau de Parfum',5,73.00,'Distribuciones Pino y asociados S.Coop.',175,'Indulge in the essence of summer with this vibrant citrus-scented Eau de Parfum. Encased in a sleek glass bottle with a bold orange cap, this fragrance embodies freshness and elegance. Perfect for daily wear, it\'s an olfactory delight that leaves a lasting, zesty impression.','2024-12-07 05:00:00'),(48,'Sleek Olive Green Hardshell Carry-On Luggage',3,48.00,'Acevedo y Estrada S.L.N.E',75,'Travel in style with our durable hardshell carry-on, perfect for weekend getaways and business trips. This sleek olive green suitcase features smooth gliding wheels for easy airport navigation, a sturdy telescopic handle, and a secure zippered compartment to keep your belongings safe. Its compact size meets most airline overhead bin requirements, ensuring a hassle-free flying experience.','2024-12-07 05:00:00'),(49,'Chic Transparent Fashion Handbag',2,61.00,'Leire Benitez Torrent S.Com.',160,'Elevate your style with our Chic Transparent Fashion Handbag, perfect for showcasing your essentials with a clear, modern edge. This trendy accessory features durable acrylic construction, luxe gold-tone hardware, and an elegant chain strap. Its compact size ensures you can carry your day-to-day items with ease and sophistication.','2024-12-07 05:00:00'),(50,'Trendy Pink-Tinted Sunglasses',4,38.00,'Comercializadora Ibéricos S.A.',150,'Step up your style game with these fashionable black-framed, pink-tinted sunglasses. Perfect for making a statement while protecting your eyes from the glare. Their bold color and contemporary design make these shades a must-have accessory for any trendsetter looking to add a pop of color to their ensemble.','2024-12-07 05:00:00'),(51,'Elegant Glass Tumbler Set',5,50.00,'Desarrollo Planas S.Coop.',60,'Enhance your drinkware collection with our sophisticated set of glass tumblers, perfect for serving your favorite beverages. This versatile set includes both clear and subtly tinted glasses, lending a modern touch to any table setting. Crafted with quality materials, these durable tumblers are designed to withstand daily use while maintaining their elegant appeal.','2024-12-07 05:00:00'),(53,'Indefinido',2,10.00,'Molins y Gallego S.A.',59,'A description','2024-12-07 05:00:00'),(54,'Indefinido',1,10.00,'Comercializadora Águila S.L.N.E',50,'A description','2024-12-07 05:00:00'),(55,'Indefinido',1,10.00,'Águila & Asociados S.L.',163,'A description','2024-12-07 05:00:00'),(59,'Indefinido',2,10.00,'Infraestructuras QQ S.L.',147,'A description','2024-12-07 05:00:00'),(61,'Indefinido',3,10.00,'Pelayo y Recio S.A.',77,'A description','2024-12-07 05:00:00'),(62,'Indefinido',5,10.00,'Manufacturas LEKM S.A.D',169,'A description','2024-12-07 05:00:00'),(63,'Indefinido',4,10.00,'Construcción Bustos S.A.',113,'A description','2024-12-07 05:00:00'),(64,'Indefinido',3,10.00,'Manu Roig Iborra S.Coop.',104,'A description','2024-12-07 05:00:00'),(65,'Indefinido',5,10.00,'Vera y asociados S.L.',14,'A description','2024-12-07 05:00:00'),(66,'выс уовыслу',3,332443.00,'Hermanos Martin S.L.N.E',43,'вам ва авав м','2024-12-07 05:00:00'),(67,'df bdfbdfb',5,634634534.00,'Banco Pi S.L.U.',193,'gdsgsdg','2024-12-07 05:00:00'),(68,'Indefinido',3,10.00,'Grupo Maldonado 